description:
Friday the 13th meets Bring it On!

When a street smart &quot;goth girl&quot; is forced to attend cheerleader camp as part of her rehabilitation from a juvenile correction facility, she clashes with the &quot;popular girls&quot;, and finds herself embroiled in a bitter rivalry with the bitchy ringleader Rachel.

But when members of the spirit squad start turning up dead, the girls must put aside their differences and struggle to survive the murderous rage of a crazed psycho-killer lurking among them!

